import React from 'react';
import './index.css';
import { Button } from '../Button';

export const ButtonBar = (props) => {
    const { nextPressed, selectedOptionNumber } = props;
    return (
        <div className="buttonBarContainer">
            <Button
                onClick={nextPressed}>
                Skip
            </Button>
            <Button
                onClick={selectedOptionNumber === 0 ? null : nextPressed}>
                Next
            </Button>
        </div>
    )
}
